class InventoryMd {  int? id;  String? warehouseName;  String? itemName;  String? productGroupNo;  String? currentStockAcquired;  String? lastUpdateDate;  InventoryMd({    this.id,    this.warehouseName,    this.itemName,    this.productGroupNo,    this.currentStockAcquired,    this.lastUpdateDate,  });  InventoryMd.fromJson(Map<String, dynamic> json) {    id = json['id'];    warehouseName = json['warehouseName'];    itemName = json['itemName'];    productGroupNo = json['productGroupNo'];    currentStockAcquired = json['currentStockAcquired'];    lastUpdateDate = json['lastUpdateDate'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = <String, dynamic>{};    data['id'] = id;    data['warehouseName'] = warehouseName;    data['itemName'] = itemName;    data['productGroupNo'] = productGroupNo;    data['currentStockAcquired'] = currentStockAcquired;    data['lastUpdateDate'] = lastUpdateDate;    return data;  }  factory InventoryMd.all() {    return InventoryMd(      id: 0,      warehouseName: '',      itemName: '',      productGroupNo: '',      currentStockAcquired: '',      lastUpdateDate: '',    );  }}